import Premade from "../storage/premade";

const SpmLek =  {

    getPremadeGame(id) {
        console.log("Starter getPremadeGame");

        Premade.map(room => {

            console.log("ID: " + room.id + " - " + id);

            if(Number(room.id) == Number(id)) {
                console.log("Funnet");
                console.log(room.questions);

                // Convert the JSON data from room into an array of questions
                questions = Object.values(room.questions);
                return room.questions;
            }
        });
    },
};



export default SpmLek;
